import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormBuilder, FormGroup, Validators, ReactiveFormsModule } from '@angular/forms';
import { IonicModule, AlertController } from '@ionic/angular';
import jsPDF from 'jspdf';

declare var paypal: any;

@Component({
  selector: 'app-realizar-pago',
  templateUrl: './realizar-pago.page.html',
  styleUrls: ['./realizar-pago.page.scss'],
  standalone: true,
  imports: [IonicModule, CommonModule, ReactiveFormsModule]
})
export class RealizarPagoPage implements OnInit {
  pagoForm: FormGroup;
  totalCompra = 10;
  boletaGenerada = false;
  datosBoleta: any = null;

  moneda: 'CLP' | 'USD' = 'USD';

  constructor(private fb: FormBuilder, private alertCtrl: AlertController) {
    this.pagoForm = this.fb.group({
      nombre: ['', Validators.required],
      rut: ['', Validators.required],
      tipoPago: ['', Validators.required],
      tipoEntrega: ['', Validators.required]
    });
  }

  ngOnInit() {}

  async confirmarPago() {
    if (this.pagoForm.valid) {
      this.datosBoleta = {
        ...this.pagoForm.value,
        total: this.totalCompra,
        fecha: new Date()
      };

      this.boletaGenerada = false;

      setTimeout(() => {
        this.initPayPal();
      }, 0);

    } else {
      const alert = await this.alertCtrl.create({
        header: 'Error',
        message: 'Por favor completa todos los campos requeridos.',
        buttons: ['Aceptar']
      });
      await alert.present();
    }
  }

  initPayPal() {
    const container = document.getElementById('paypal-button-container');
    if (container) container.innerHTML = '';

    paypal.Buttons({
      createOrder: (data: any, actions: any) => {
        let valorPago: string;

        try {
          if (this.moneda === 'CLP') {
            const valorEntero = Math.floor(Number(this.totalCompra));
            if (isNaN(valorEntero) || valorEntero < 1) {
              console.error('Total inválido para CLP:', this.totalCompra);
              throw new Error('Total de compra inválido para CLP');
            }
            valorPago = valorEntero.toString();
          } else {
            const valorFloat = Number(this.totalCompra) / 1000;
            if (isNaN(valorFloat) || valorFloat < 0.01) {
              console.error('Total inválido para USD:', this.totalCompra);
              throw new Error('Total de compra inválido para USD');
            }
            valorPago = valorFloat.toFixed(2);
          }

          console.log('Creando orden con:', {
            currency_code: this.moneda,
            value: valorPago
          });

          return actions.order.create({
            purchase_units: [{
              amount: {
                currency_code: this.moneda,
                value: valorPago
              }
            }]
          });

        } catch (err) {
          console.error('Error preparando orden:', err);
          throw err;
        }
      },

      onApprove: async (data: any, actions: any) => {
        try {
          const details = await actions.order.capture();
          console.log('Pago aprobado por:', details.payer.name?.given_name || 'Desconocido');

          this.boletaGenerada = true;

          // Generar y descargar PDF aquí
          this.generarPDF(this.datosBoleta);

          const alert = await this.alertCtrl.create({
            header: 'Pago Realizado',
            message: 'Tu boleta ha sido generada correctamente.',
            buttons: ['Aceptar']
          });
          await alert.present();

          if (container) container.innerHTML = '';

        } catch (error) {
          console.error('Error capturando el pago:', error);
          const alert = await this.alertCtrl.create({
            header: 'Error',
            message: 'Hubo un problema al confirmar el pago.',
            buttons: ['Aceptar']
          });
          await alert.present();
        }
      },

      onError: async (err: any) => {
        console.error('Error en el proceso de pago:', err);
        const alert = await this.alertCtrl.create({
          header: 'Error de Pago',
          message: 'Ocurrió un error durante el proceso de pago. Intenta nuevamente.',
          buttons: ['Aceptar']
        });
        await alert.present();
      }
    }).render('#paypal-button-container');
  }

  generarPDF(datos: any) {
    const doc = new jsPDF();
    const logoBase64 = "data:image/png;base64,"
    doc.addImage(logoBase64, 'PNG', 150, 10, 40, 20);

    doc.setFontSize(20);
    doc.setFont('helvetica', 'bold');
    doc.text('Boleta de Compra', 14, 35);

    doc.setDrawColor(0);
    doc.setLineWidth(0.5);
    doc.line(14, 40, 196, 40);

    doc.setFontSize(12);
    doc.setFont('helvetica', 'normal');
    doc.text(`Nombre: ${datos.nombre}`, 14, 50);
    doc.text(`RUT: ${datos.rut}`, 14, 58);
    doc.text(`Tipo de Pago: ${datos.tipoPago}`, 14, 66);
    doc.text(`Tipo de Entrega: ${datos.tipoEntrega}`, 14, 74);

    doc.line(14, 85, 196, 85);

    const fechaStr = new Date(datos.fecha).toLocaleString();
    doc.text(`Fecha: ${fechaStr}`, 14, 95);

    doc.setFont('helvetica', 'bold');
    doc.text(`Total: $${datos.total.toLocaleString('es-CL')} CLP`, 14, 105);

    doc.setFont('helvetica', 'italic');
    doc.setFontSize(10);
    doc.text('¡Gracias por tu compra!', 14, 125);

    doc.save(`boleta_${datos.rut}_${Date.now()}.pdf`);
  }
}
